using System.Collections.Generic;
using Xunit;

namespace HeapChecks;

public class MinimumNumberKConsecutiveBitFlips
{
    public class Solution
    {
        public int MinKBitFlips(int[] nums, int k)
        {
            var count = 0;
            var q = new Queue<int>();
            for (var i = 0; i < nums.Length; i++)
            {
                var found = q.TryPeek(out var j);
                if (found && i == j)
                    q.Dequeue();

                if (nums[i] != (q.Count % 2 == 0 ? 1 : 0))
                {
                    if (i > nums.Length - k) return -1;
                    q.Enqueue(i + k);
                    count++;
                }
            }

            return count;
        }
    }

    [Fact]
    public void Example1()
    {
        var nums = new[] { 0, 1, 0 };
        var k = 1;
        var solution = new Solution();
        Assert.Equal(2, solution.MinKBitFlips(nums, k));
    }

    [Fact]
    public void Example2()
    {
        var nums = new[] { 1, 1, 0 };
        var k = 2;
        var solution = new Solution();
        Assert.Equal(-1, solution.MinKBitFlips(nums, k));
    }

    [Fact]
    public void Example3()
    {
        var nums = new[] { 0, 0, 0, 1, 0, 1, 1, 0 };
        var k = 3;
        var solution = new Solution();
        Assert.Equal(3, solution.MinKBitFlips(nums, k));
    }

